package operator;

public class RelationalOperator {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int a=5;
		int b=10;
		int c=4;
		int d=5;
		
		System.out.println(a==b);
		System.out.println(a==c);
		System.out.println(a==d);
		
		System.out.println(a<c);
		System.out.println(a>c);
		
		System.out.println(a!=c);
		
		System.out.println(a>=c);
		System.out.println(a<=c);
		
		System.out.println(a==d);
		
		

	}

}
